import React from "react";
import Table from '@material-ui/core/Table';
import TableBody from '@material-ui/core/TableBody';
import TableCell from '@material-ui/core/TableCell';
import TableContainer from '@material-ui/core/TableContainer';
import TableHead from '@material-ui/core/TableHead';
import TableRow from '@material-ui/core/TableRow';
import Paper from '@material-ui/core/Paper';
import styles from "../table/table.css";

const TableData = ({ data: { Arunachal, Assam, Manipur, Meghalaya, Mizoram, Nagaland, Tripura } }) => {
    return (
        <TableContainer component={Paper}>
            <Table className={styles.container} aria-label="simple table">
                <TableHead>
                    <TableRow>
                        <TableCell>State</TableCell>
                        <TableCell className="alert alert-warning" align="right">District</TableCell>
                        <TableCell className="alert alert-success" align="right">Infected</TableCell>

                    </TableRow>
                </TableHead>
                <TableBody>
                    <TableCell component="th" scope="row">
                        {Assam.districtData.Cachar.confirmed}
                    </TableCell>
                    {/* {fetchedState.map(({ Assam }, i) => ( */}
                    {/* <TableRow >

                        <TableCell className="alert alert-warning" align="right">{Assam.districtData}</TableCell>
                        <TableCell className="alert alert-success" align="right">{Assam.districtData.Cachar.confirmed}</TableCell>

                    </TableRow> */}
                    {/* ))} */}
                </TableBody>
            </Table>
        </TableContainer>
    )
}

export default TableData
